(1, 'aText', NULL, 'Home'),
(2, 'aText', NULL, 'Accueil'),
(3, 'aRichText', NULL, '<h3>Welcome to aSandbox, a sample site built using <a href="http://www.apostrophenow.com" rel="external">Apostrophe</a>.</h3> <p>You can edit this text by clicking the Edit button. You can also add additional slots to this area, such as video and slideshow slots, via the Add Slot button.</p>\n'),
(4, 'aRichText', NULL, '<h3>Bienvenue dans le aSandbox, un exemple de site réalisé en utilisant  <a href="http://www.apostrophenow.com" rel="external">Apostrophe</a>.</h3>  <p>Vous pouvez éditer ce texte en cliquant sur le bouton &laquo;&nbsp;Editer&nbsp;&raquo;. Vous pouvez  également ajouter des emplacements supplémentaires à cette zone, tel qu''un  emplacement vidéo ou un emplacement diaporama, en utilisant le bouton &laquo;&nbsp;Ajouter  un emplacement&nbsp;&raquo;.</p>\n'),
