(7, 'aRichText', NULL, '<h3>For more information or help with <a href="http://www.apostrophenow.com" rel="external">Apostrophe</a>, contact <a href="mailto:apostrophe@punkave.com">apostrophe@punkave.com</a></h3>\n'),
(8, 'aRichText', NULL, '<h3>Pour plus d''informations ou obtenir de l''aide au sujet  d''<a href="http://www.apostrophenow.com" rel="external">Apostrophe</a>,  contactez <a href="mailto:apostrophe@punkave.com">apostrophe@punkave.com</a></h3>\n'),
