(31, 'aRichText', NULL, '<h3>\n	Welcome to BC a staging site for a web application in active development</h3>\n<p>\n	This staging site is an incomplet first draft of a complicated web application. &nbsp;It''s also a naked app, meaning the final design &amp; some interactions have not been defined yet. &nbsp;This means the application looks more like the application wireframes than a polished appication.</p>'),
(32, 'aRichText', NULL, '<h3>\n	Project Stakeholders</h3>\n<p>\n	Only the primary menu is setup so use this <a href="/login">link to login</a></p>\n<p>\n	<a href="/register">Registration is roughed in and can be reviewed with this link</a></p>\n<p>\n	The dashboard can be accessed through searching for a book or going to <a href="/dashboard">/dashboard</a></p>'),
