(43, 'aRichText', NULL, '<h3>\n	Terms Of Use</h3>\n<br />\n<div>\n	FPO Terms of Service (swiped from google for planning purposes)</div>\n<div>\n	&nbsp;</div>\n<div>\n	Welcome to BookCheetah!</div>\n<div>\n	&nbsp;</div>\n<div>\n	1. Your relationship with BookCheetah</div>\n<div>\n	&nbsp;</div>\n<div>\n	1.1 Your use of Google&rsquo;s products, software, services and web sites (referred to collectively as the &ldquo;Services&rdquo; in this document and excluding any services provided to you by Google under a separate written agreement) is subject to the terms of a legal agreement between you and Google. &ldquo;Google&rdquo; means Google Inc., whose principal place of business is at 1600 Amphitheatre Parkway, Mountain View, CA 94043, United States. This document explains how the agreement is made up, and sets out some of the terms of that agreement.</div>\n<div>\n	&nbsp;</div>\n<div>\n	1.2 Unless otherwise agreed in writing with Google, your agreement with Google will always include, at a minimum, the terms and conditions set out in this document. These are referred to below as the &ldquo;Universal Terms&rdquo;.</div>\n<div>\n	&nbsp;</div>\n<div>\n	1.3 Your agreement with Google will also include the terms of any Legal Notices applicable to the Services, in addition to the Universal Terms. All of these are referred to below as the &ldquo;Additional Terms&rdquo;. Where Additional Terms apply to a Service, these will be accessible for you to read either within, or through your use of, that Service.</div>\n<div>\n	&nbsp;</div>\n<div>\n	1.4 The Universal Terms, together with the Additional Terms, form a legally binding agreement between you and Google in relation to your use of the Services. It is important that you take the time to read them carefully. Collectively, this legal agreement is referred to below as the &ldquo;Terms&rdquo;.</div>\n<div>\n	&nbsp;</div>\n<div>\n	1.5 If there is any contradiction between what the Additional Terms say and what the Universal Terms say, then the Additional Terms shall take precedence in relation to that Service.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Accepting the Terms</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.1 In order to use the Services, you must first agree to the Terms. You may not use the Services if you do not accept the Terms.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.2 You can accept the Terms by:</div>\n<div>\n	&nbsp;</div>\n<div>\n	(A) clicking to accept or agree to the Terms, where this option is made available to you by Google in the user interface for any Service; or</div>\n<div>\n	&nbsp;</div>\n<div>\n	(B) by actually using the Services. In this case, you understand and agree that Google will treat your use of the Services as acceptance of the Terms from that point onwards.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.3 You may not use the Services and may not accept the Terms if (a) you are not of legal age to form a binding contract with Google, or (b) you are a person barred from receiving the Services under the laws of the United States or other countries including the country in which you are resident or from which you use the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.4 Before you continue, you should print off or save a local copy of the Universal Terms for your records.</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Language of the Terms</div>\n<div>\n	&nbsp;</div>\n<div>\n	3.1 Where Google has provided you with a translation of the English language version of the Terms, then you agree that the translation is provided for your convenience only and that the English language versions of the Terms will govern your relationship with Google.</div>\n<div>\n	&nbsp;</div>\n<div>\n	3.2 If there is any contradiction between what the English language version of the Terms says and what a translation says, then the English language version shall take precedence.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4. Provision of the Services by Google</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.1 Google has subsid