that any registration information you give to Google will always be accurate, correct and up to date.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.2 You agree to use the Services only for purposes that are permitted by (a) the Terms and (b) any applicable law, regulation or generally accepted practices or guidelines in the relevant jurisdictions (including any laws regarding the export of data or software to and from the United States or other relevant countries).</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.3 You agree not to access (or attempt to access) any of the Services by any means other than through the interface that is provided by Google, unless you have been specifically allowed to do so in a separate agreement with Google. You specifically agree not to access (or attempt to access) any of the Services through any automated means (including use of scripts or web crawlers) and shall ensure that you comply with the instructions set out in any robots.txt file present on the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.4 You agree that you will not engage in any activity that interferes with or disrupts the Services (or the servers and networks which are connected to the Services).</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.5 Unless you have been specifically permitted to do so in a separate agreement with Google, you agree that you will not reproduce, duplicate, copy, sell, trade or resell the Services for any purpose.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.6 You agree that you are solely responsible for (and that Google has no responsibility to you or to any third party for) any breach of your obligations under the Terms and for the consequences (including any loss or damage which Google may suffer) of any such breach.</div>\n<div>\n	&nbsp;</div>\n<div>\n	6. Your passwords and account security</div>\n<div>\n	&nbsp;</div>\n<div>\n	6.1 You agree and understand that you are responsible for maintaining the confidentiality of passwords associated with any account you use to