ou may do so by Google or by the owners of that Content, in a separate agreement.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.3 Google reserves the right (but shall have no obligation) to pre-screen, review, flag, filter, modify, refuse or remove any or all Content from any Service. For some of the Services, Google may provide tools to filter out explicit sexual content. These tools include the SafeSearch preference settings (see http://www.google.com/help/customize.html#safe). In addition, there are commercially available services and software to limit access to material that you may find objectionable.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.4 You understand that by using the Services you may be exposed to Content that you may find offensive, indecent or objectionable and that, in this respect, you use the Services at your own risk.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.5 You agree that you are solely responsible for (and that Google has no responsibility to you or to any third party for) any Content that you create, transmit or display while using the Services and for the consequences of your actions (including any loss or damage which Google may suffer) by doing so.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9. Proprietary rights</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.1 You acknowledge and agree that Google (or Google&rsquo;s licensors) own all legal right, title and interest in and to the Services, including any intellectual property rights which subsist in the Services (whether those rights happen to be registered or not, and wherever in the world those rights may exist). You further acknowledge that the Services may contain information which is designated confidential by Google and that you shall not disclose such information without Google&rsquo;s prior written consent.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.2 Unless you have agreed otherwise in writing with Google, nothing in the Terms gives you a right to use any of Google&rsquo;s trade names, trade marks, service marks, logos, domain names, and other distinctive brand features.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.3 If you have been given an explicit right to use any of these brand features in a separate written agreement with Google, then you agree that your use of such features shall be in compliance with that agreement, any applicable provisions of the Terms, and Google''s brand feature use guidelines as updated from time to time. These guidelines can be viewed online at http://www.google.com/permissions/guidelines.html (or such other URL as Google may provide for this purpose from time to time).</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.4 Other than the limited license set forth in Section 11, Google acknowledges and agrees that it obtains no right, title or interest from you (or your licensors) under these Terms in or to any Content that you submit, post, transmit or display on, or through, the Services, including any intellectual property rights which subsist in that Content (whether those rights happen to be registered or not, and wherever in the world those rights may exist). Unless you have agreed otherwise in writing with Google, you agree that you are responsible for protecting and enforcing those rights and that Google has no obligation to do so on your behalf.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.5 You agree that you shall not remove, obscure, or alter any proprietary rights notices (including copyright and trade mark notices) which may be affixed to or contained within the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.6 Unless you have been expressly authorized to do so in writing by Google, you agree that in using the Services, you will not use any trade mark, service mark, trade name, logo of any company or organization in a way that is likely or intended to cause confusion about the owner or authorized user of such marks, names or logos.</div>\n<div>\n	&nbsp;</div>\n<div>\n	10. License from Google</div>\n<div>\n	&nbsp;</div>\n<div>\n	10.1 Google gives you a personal, worldwide, royalty-free, non-assignable and non-exclusive license to use the software provided to you by Google as part of the Services as provided to you by Google (referred to as the &ldquo;Software&rdquo; below). This license is for the sole purpose of enabling you to use and enjoy the benefit of the Services as provided by Google, in the manner permitted by the Terms.</div>\n<div>\n	&nbsp;</div>\n<div>\n	10.2 You may not (and you may not permit anyone else to) copy, modify, create a derivative work of, reverse engineer, decompile or otherwise attempt to extract the source code of the Software or any part thereof, unless this is expressly permitted or required by law, or unless you have been specifically told that you may do so by Google, in writing.</div>\n<div>\n	&nbsp;</div>\n<div>\n	10.3 Unless Google has given you specific written permission to do so, you may not assign (or grant a sub-license of) your rights to use the Software, grant a security interest in or over your rights to use the Software, or otherwise transfer any part of your rights to use the Software.</div>'),
(44, 'aRichText', NULL, '<p>\n	<a href="/how-it-works">How It Works</a>&nbsp;| <a href="/terms-of-use">Terms Of Use</a>&nbsp;|&nbsp;</p>'),
(45, 'aText', NULL, 'Privacy Policy'),
(46, 'aText', NULL, 'Privacy Policy'),
(47, 'aRichText', NULL, '<h3>\n	Privacy Policy</h3>\n<br />\n<div>\n	This Privacy Policy applies to all services and products provided by PearWords. To seek clarification of any point contained herein, please contact us online or write to us at:</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords,</div>\n<div>\n	1 Ropemaker Street,</div>\n<div>\n	City of London,</div>\n<div>\n	EC2Y 9HT,</div>\n<div>\n	United Kingdom.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Summary</div>\n<div>\n	&nbsp;</div>\n<div>\n	This Privacy Policy outlines all aspects of what data PearWords may receive about you and how, and your rights regarding that collection. PearWords we will never sell, rent, trade or license, in whole-part or piecemeal, any information that we hold about or relating to you, gathered through intent or passively, to any third-party and that access to your information within PearWords will be restricted and accessible only where necessary to the function for which it was collected.</div>\n<div>\n	Data handling principles</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords collects data...</div>\n<div>\n	&nbsp;</div>\n<div>\n	For the effective provision of its services;</div>\n<div>\n	To ensure the integrity of its systems and the safety of its employees;</div>\n<div>\n	To prevent unauthorised access to and abuse of PearWord''s resources and data.</div>\n<div>\n	PearWords does not...</div>\n<div>\n	&nbsp;</div>\n<div>\n	Cross-reference or collate passed and passive data to generate "user profiles";</div>\n<div>\n	Seek any more information except than that which is absolutely necessary for the desired function to be carried out;</div>\n<div>\n	Place "cookies" (small text files) on your system for any reason.</div>\n<div>\n	Data we collect</div>\n<div>\n	&nbsp;</div>\n<div>\n	Passed data is information about yourself that you actively and wilfully pass to us by explicitly engaging with active functions of the PearWords site, such as writing to us through our contact form or becoming a client. Any passed information relating to a person or organisation other than your own self that PearWords can reasonably assume that entity would find it disagreeable for PearWords to hold shall have that information removed from PearWord''s systems as soon as possible.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Passive data covers all data that we receive about you through your casual engagement with PearWords, including: the type of device you are accessing the site through; your browser; and your connection speed; in some cases, this information may be collected in conjunction with external resources (see "Related policies").</div>\n<div>\n	&nbsp;</div>\n<div>\n	Data security</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords take all reasonable physical and digital precautions to ensure the integrity of your data against modification, disclosure or destruction, at least as carefully as it would for its own data. Should any unauthorised access occur, accidentally or otherwise, PearWords will seek to immediately notify any concerned parties and advise them of remedial action.</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords enforces strict data handling and management practices among all its employees, and has guidelines on disciplinary action up to contract termination and criminal prosecution.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Your rights</div>\n<div>\n	&nbsp;</div>\n<div>\n	You can, at any time, request that PearWords permanently erase any and all personal and identifiable information directly related to your person or company at any time, and PearWords will endeavour to adhere to this request as quickly as possible and notify you of its completion.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Changes</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords may, from time to time, change the wording or features of this policy; though PearWords shall not debase its fundamental tenants as described in the "Summary". PearWords shall retain online and make available an accessible archive of previous policies when an update occurs. Further, PearWords shall endeavour to take reasonable action towards notifying users of any changes.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Related policies</div>\n<div>\n	&nbsp;</div>\n<div>\n	PearWords utilises services of Google Inc, so thus advise on the location of Google''s Privacy Policy.</div>'),
(48, 'aRichText', NULL, '<p>\n	<a href="/how-it-works">How It Works</a>&nbsp;| <a href="/terms-of-use">Terms Of Use</a>&nbsp;| <a href="/privacy-policy">Privacy Policy</a>&nbsp;|&nbsp;</p>'),
