(77, 'aRichText', NULL, '<h3>\n	&nbsp;</h3>\n<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>\n<p>\n	This staging site is an incomplet first draft of a complicated web application. &nbsp;It''s also a naked app, meaning the final design &amp; some interactions have not been defined yet. &nbsp;This means the application looks more like the application wireframes than a polished appication.</p>\n<h3>\n	<strong>DON''T PANIC</strong></h3>\n<p>\n	This application is still in the very early stages of development, there are MANY bugs &amp; MANY missing features. &nbsp;It''s supposed to be that way.</p>\n<p>\n	This Application has only been tested in Google Chrome expect Internet Explorer to do odd things.</p>\n<p>\n	The JS &amp; CSS have not been optimized.</p>'),
(78, 'aRichText', NULL, '<h3>\n	&nbsp;</h3>\n<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>\n<p>\n	If you''re new here, welcome! Accounts are free, so check out <a href="">how they work</a> and then take 3 minutes to <a href="">create your account</a>.</p>\n<p>\n	If you&rsquo;re already familiar with BookCheetah, then welcome back! <a href="">Sign in</a> so that you can update your Bookshelf or Wishlist.</p>'),
(79, 'aRichText', NULL, '<h3>Let us find the books you want, from other students on your campus.</h3>\n<h3>Or let us find nearby students who want the books you no longer need.</h3>\n<p>If you''re new here, welcome! Accounts are free, so check out <a href="">how they work</a> and then take 3 minutes to <a href="">create your account</a>.</p>\n<p>If you&rsquo;re already familiar with BookCheetah, then welcome back! <a href="">Sign in</a> so that you can update your Bookshelf or Wishlist.</p>'),
