(86, 'aRichText', NULL, '<h3>\n	Off Menu Pages</h3>\n<p>\n	Pages that are not in the main menu.</p>\n<p>\n	This list is used to allow these pages to continue to be used&nbsp;</p>'),
(87, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<br /><p>\n	BookCheetah is as easy as 1-2-3&nbsp;&nbsp; &nbsp;<br /><br />\n	1. Sign up for a free account. It takes 3 minutes.<br /><br />\n	2. Add books you have to your bookshelf. Add books you want to your wishlist. You can list items for trade, borrow, rent or sale.<br /><br />\n	3. Let us find people near you, people who have what you want, or who want what you have.<br /><br />\n	If you like a particular match, then buy a token to contact the seller (or buyer) and arrange a meeting.<br /><br />\n	This way, you can receive the book in person, saving on shipping and your carbon footprint. You won&iacute;t have to wait for shipping, or wonder about the actual condition of the book you&iacute;re buying.<br /><br />\n	Plus, you&iacute;ll keep your book-buying dollars where they belong&Ouml; in student pockets.<br /><br />\n	What do we charge? Just a matchmaking fee of $0.99 per token or &igrave;match&icirc;. For the price of a cheap iTunes track, you could find your next textbook.<br /><br />\n	And you can feel good about your tokens, because a share of every dollar we earn goes to your choice of three worthy charities: The Cheetah Conservation Fund, Teach for America, or the student government of your school. [insert links to CCF and TFA nearby]</p>'),
(88, 'aRichText', NULL, '<p>\n	Thanks for contacting us here at BookCheetah. We&iacute;re always looking for ways to improve, so look forward to addressing your comment.</p>'),
(89, 'aRichText', NULL, '<p>\n	Thanks for contacting us here at BookCheetah.<br />\n	We are always looking for ways to improve, so look forward to addressing your comment.</p>'),
(90, 'aText', NULL, 'ISBN'),
(91, 'aRichText', NULL, '<h3>\n	What is an ISBN?</h3>\n<p>\n	An ISBN is a unique number assigned to each published text. Use it to avoid getting the wrong book that shares the same title, or even a different edition of the same book (as ISBNs change with each edition).</p>');
