(92, 'aRichText', NULL, '<h3>\n	What is an ISBN?</h3>\n<br />\n<p>\n	An ISBN is a unique number assigned to each published text. Use it to avoid getting the wrong book that shares the same title, or even a different edition of the same book (as ISBNs change with each edition).</p>'),
(93, 'aRichText', NULL, '<p>\n	<strong>PRIVACY AND ONLINE DATA COLLECTION NOTICE</strong> - Effective April 1, 2012</p>\n<br />\n<p>\n	<strong>TABLE OF CONTENTS</strong></p>\n<ul><li>\n		Our Commitment to Privacy</li>\n	<li>\n		The Information We Collect</li>\n	<li>\n		How We Use Information</li>\n	<li>\n		Our Commitment to Data Security</li>\n	<li>\n		Our Commitment to Children&rsquo;s Privacy</li>\n	<li>\n		How to Access or Correct Your Information</li>\n	<li>\n		Changes Regarding this Privacy and Online Data Collection Notice</li>\n	<li>\n		How to Contact Us</li>\n</ul><br />\n<p>\n	<strong>OUR COMMITMENT TO PRIVACY</strong></p>\n<br />\n<p>\n	Your privacy is important to us.&nbsp; To better protect your privacy, we provide this notice explaining our online information practices and the choices you can make about the way your information is collected and used. &nbsp;At BookCheetah, we will never sell, rent, trade or license, in whole-part or piecemeal, any information that we hold about or relating to you, however gathered, to any third-party. Access to your information with BookCheetah will be restricted and accessible only where necessary to the function for which it was collected.&nbsp; To make this notice easy to find, we make it available on our homepage and at every point where personally identifiable information may be requested.</p>\n<br />\n<p>\n	<strong>THE INFORMATION WE COLLECT</strong><br />\n	&nbsp;</p>\n<p>\n	This notice applies to all information collected or submitted on the BookCheetah web site.&nbsp; The types of personal information collected by BookCheetah&rsquo;s web pages are:</p>\n<br />\n<p>\n	Name</p>\n<p>\n	Email address</p>\n<p>\n	School</p>\n<br />\n<p>\n	You may elect to provide the following information for specific activities on our website:</p>\n<p>\n	Address(es) if provided</p>\n<p>\n	Phone number if provided</p>\n<p>\n	Credit/Debit card information if provided</p>\n<p>\n	Book identifiers if provided</p>\n<p>\n	<br /><strong>HOW WE USE INFORMATION</strong></p>\n<br />\n<p>\n	We use the information you provide about yourself when you are attempting to trade a book(s) or order a product only to complete that book trade or order.&nbsp; We do not share this information with outside parties except to the extent necessary to complete that trade or order.</p>\n<br />\n<p>\n	We use return email addresses to answer the email we receive, and to connect you with someone with whom you elect to communicate.&nbsp; We will occasionally email you to remind you of opportunities to buy or sell items you have placed on your bookshelf or wishlist.&nbsp; Such addresses are not used for any other purpose and are not shared with outside parties.</p>\n<br />\n<p>\n	You can &ldquo;like us on Facebook&rdquo; if you would like to receive special offers or announcements of service updates.&nbsp; Information you submit on our website will otherwise not be used for this purpose.</p>\n<br />\n<p>\n	We use non-identifying and aggregate information to better design our web site and to share with potential advertisers.&nbsp; For example, we may tell an advertiser that <em>x </em>number of individuals visited a certain area on our website, or that <em>y </em>number of men and <em>z</em> number of women filled out our registration form, but we would not disclose anything that could be used to identify those individuals.</p>\n<br />\n<p>\n	Passed data is information about yourself that you actively and willfully pass to us by explicitly engaging in active functions on the BookCheetah web site, such as contacting us through the BookCheetah web site email contact form or entering information to conduct a book trade.&nbsp; BookCheetah reserves the right, in its sole discretion, to immediately remove any information generated by you relating to yourself, another person, web site, entity or other organization that BookCheetah determines might be disagreeable to BookCheetah or others.</p>\n<br />\n<p>\n	Finally, we never use or share the personally identifiable information provided to us online in ways unrelated to the ones described above, including generating cross-reference or collate-passed and passive data to generate &ldquo;user profiles,&rdquo; without also providing you an opportunity to opt-out or otherwise prohibit such unrelated uses.&nbsp; We never seek any more information except that which is absolutely necessary for the desired action to be completed.&nbsp; We do not place &ldquo;cookies&rdquo; (small text files) on your system for any reason.</p>\n<br />\n<p>\n	<strong>OUR COMMITMENT TO DATA SECURITY</strong></p>\n<br />\n<p>\n	To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect online to protect the integrity of your data, at least as carefully as it would for BookCheetah&rsquo;s data, against modification, disclosure or destruction.&nbsp; In the event it is discovered that unauthorized access to data occurred, accidentally or otherwise, BookCheetah will attempt to immediately notify you and explain BookCheetah&rsquo;s remedial action.</p>\n<br />\n<p>\n	<strong>OUR COMMITMENT TO CHILDREN&rsquo;S PRIVACY</strong></p>\n<br />\n<p>\n	Protecting the privacy of the very young is very important.&nbsp; For that reason, BookCheetah never collects or maintains information at our website from those we actually know are under 13, and no part of our web site is structured to attract anyone under 13.</p>\n<br />\n<p>\n	<strong>HOW TO ACCESS OR CORRECT YOUR INFORMATION</strong></p>\n<br />\n<p>\n	You can access all your personally identifiable information that we collect online and maintain by reviewing your profile via the links on every page of our website.&nbsp; We use this procedure to better safeguard your information.</p>\n<br />\n<p>\n	You can correct factual errors in your personally identifiable information by changing your profile online, or by sending us a request that credibly shows error.&nbsp; You can, at any time, request that BookCheetah permanently erase any and all of your personal and identifiable information directly related to yourself at any time and BookCheetah will take action regarding your request as quickly as reasonably possible and notify you when the action is completed.</p>\n<br />\n<p>\n	To protect your privacy and security, we will also take reasonable steps to verify your identify before granting access or making corrections.</p>\n<br />\n<p>\n	<strong>CHANGES REGARDING THIS PRIVACY AND ONLINE DATA COLLECTION NOTICE</strong></p>\n<br />\n<p>\n	BookCheetah reserves the right to change or modify the terms of this Privacy and Online Data Collection Notice and shall take reasonable action to notify BookCheetah users of any changes.</p>\n<br />\n<p>\n	<strong>HOW TO CONTACT US</strong></p>\n<br />\n<p>\n	Should you have other questions or concerns about these privacy policies, please email us at info@bookcheetah.com.</p>'),
