nce in relation to that Service.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2. Accepting the Terms</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.1 In order to use the Services, you must first agree to the Terms. You may not use the Services if you do not accept the Terms.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.2 You can accept the Terms by:</div>\n<div>\n	&nbsp;</div>\n<div>\n	(A) clicking to accept or agree to the Terms, where this option is made available to you by Google in the user interface for any Service; or</div>\n<div>\n	&nbsp;</div>\n<div>\n	(B) by actually using the Services. In this case, you understand and agree that Google will treat your use of the Services as acceptance of the Terms from that point onwards.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.3 You may not use the Services and may not accept the Terms if (a) you are not of legal age to form a binding contract with Google, or (b) you are a person barred from receiving the Services under the laws of the United States or other countries including the country in which you are resident or from which you use the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	2.4 Before you continue, you should print off or save a local copy of the Universal Terms for your records.</div>\n<div>\n	&nbsp;</div>\n<div>\n	3. Language of the Terms</div>\n<div>\n	&nbsp;</div>\n<div>\n	3.1 Where Google has provided you with a translation of the English language version of the Terms, then you agree that the translation is provided for your convenience only and that the English language versions of the Terms will govern your relationship with Google.</div>\n<div>\n	&nbsp;</div>\n<div>\n	3.2 If there is any contradiction between what the English language version of the Terms says and what a translation says, then the English language version shall take precedence.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4. Provision of the Services by Google</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.1 Google has subsidiaries and affiliated legal entities around the world (&ldquo;Subsidiaries and Affiliates&rdquo;). Sometimes, these companies will be providing the Services to you on behalf of Google itself. You acknowledge and agree that Subsidiaries and Affiliates will be entitled to provide the Services to you.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.2 Google is constantly innovating in order to provide the best possible experience for its users. You acknowledge and agree that the form and nature of the Services which Google provides may change from time to time without prior notice to you.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.3 As part of this continuing innovation, you acknowledge and agree that Google may stop (permanently or temporarily) providing the Services (or any features within the Services) to you or to users generally at Google&rsquo;s sole discretion, without prior notice to you. You may stop using the Services at any time. You do not need to specifically inform Google when you stop using the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.4 You acknowledge and agree that if Google disables access to your account, you may be prevented from accessing the Services, your account details or any files or other content which is contained in your account.</div>\n<div>\n	&nbsp;</div>\n<div>\n	4.5 You acknowledge and agree that while Google may not currently have set a fixed upper limit on the number of transmissions you may send or receive through the Services or on the amount of storage space used for the provision of any Service, such fixed upper limits may be set by Google at any time, at Google&rsquo;s discretion.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5. Use of the Services by you</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.1 In order to access certain Services, you may be required to provide information about yourself (such as identification or contact details) as part of the registration process for the Service, or as part of your continued use of the Services. You agree that any registration information you give to Google will always be accurate, correct and up to date.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.2 You agree to use the Services only for purposes that are permitted by (a) the Terms and (b) any applicable law, regulation or generally accepted practices or guidelines in the relevant jurisdictions (including any laws regarding the export of data or software to and from the United States or other relevant countries).</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.3 You agree not to access (or attempt to access) any of the Services by any means other than through the interface that is provided by Google, unless you have been specifically allowed to do so in a separate agreement with Google. You specifically agree not to access (or attempt to access) any of the Services through any automated means (including use of scripts or web crawlers) and shall ensure that you comply with the instructions set out in any robots.txt file present on the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.4 You agree that you will not engage in any activity that interferes with or disrupts the Services (or the servers and networks which are connected to the Services).</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.5 Unless you have been specifically permitted to do so in a separate agreement with Google, you agree that you will not reproduce, duplicate, copy, sell, trade or resell the Services for any purpose.</div>\n<div>\n	&nbsp;</div>\n<div>\n	5.6 You agree that you are solely responsible for (and that Google has no responsibility to you or to any third party for) any breach of your obligations under the Terms and for the consequences (including any loss or damage which Google may suffer) of any such breach.</div>\n<div>\n	&nbsp;</div>\n<div>\n	6. Your passwords and account security</div>\n<div>\n	&nbsp;</div>\n<div>\n	6.1 You agree and understand that you are responsible for maintaining the confidentiality of passwords associated with any account you use to access the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	6.2 Accordingly, you agree that you will be solely responsible to Google for all activities that occur under your account.</div>\n<div>\n	&nbsp;</div>\n<div>\n	6.3 If you become aware of any unauthorized use of your password or of your account, you agree to notify Google immediately at http://www.google.com/support/accounts/bin/answer.py?answer=58585.</div>\n<div>\n	&nbsp;</div>\n<div>\n	7. Privacy and your personal information</div>\n<div>\n	&nbsp;</div>\n<div>\n	7.1 For information about Google&rsquo;s data protection practices, please read Google&rsquo;s privacy policy at http://www.google.com/privacy.html. This policy explains how Google treats your personal information, and protects your privacy, when you use the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	7.2 You agree to the use of your data in accordance with Google&rsquo;s privacy policies.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8. Content in the Services</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.1 You understand that all information (such as data files, written text, computer software, music, audio files or other sounds, photographs, videos or other images) which you may have access to as part of, or through your use of, the Services are the sole responsibility of the person from which such content originated. All such information is referred to below as the &ldquo;Content&rdquo;.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.2 You should be aware that Content presented to you as part of the Services, including but not limited to advertisements in the Services and sponsored Content within the Services may be protected by intellectual property rights which are owned by the sponsors or advertisers who provide that Content to Google (or by other persons or companies on their behalf). You may not modify, rent, lease, loan, sell, distribute or create derivative works based on this Content (either in whole or in part) unless you have been specifically told that you may do so by Google or by the owners of that Content, in a separate agreement.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.3 Google reserves the right (but shall have no obligation) to pre-screen, review, flag, filter, modify, refuse or remove any or all Content from any Service. For some of the Services, Google may provide tools to filter out explicit sexual content. These tools include the SafeSearch preference settings (see http://www.google.com/help/customize.html#safe). In addition, there are commercially available services and software to limit access to material that you may find objectionable.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.4 You understand that by using the Services you may be exposed to Content that you may find offensive, indecent or objectionable and that, in this respect, you use the Services at your own risk.</div>\n<div>\n	&nbsp;</div>\n<div>\n	8.5 You agree that you are solely responsible for (and that Google has no responsibility to you or to any third party for) any Content that you create, transmit or display while using the Services and for the consequences of your actions (including any loss or damage which Google may suffer) by doing so.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9. Proprietary rights</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.1 You acknowledge and agree that Google (or Google&rsquo;s licensors) own all legal right, title and interest in and to the Services, including any intellectual property rights which subsist in the Services (whether those rights happen to be registered or not, and wherever in the world those rights may exist). You further acknowledge that the Services may contain information which is designated confidential by Google and that you shall not disclose such information without Google&rsquo;s prior written consent.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.2 Unless you have agreed otherwise in writing with Google, nothing in the Terms gives you a right to use any of Google&rsquo;s trade names, trade marks, service marks, logos, domain names, and other distinctive brand features.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.3 If you have been given an explicit right to use any of these brand features in a separate written agreement with Google, then you agree that your use of such features shall be in compliance with that agreement, any applicable provisions of the Terms, and Google''s brand feature use guidelines as updated from time to time. These guidelines can be viewed online at http://www.google.com/permissions/guidelines.html (or such other URL as Google may provide for this purpose from time to time).</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.4 Other than the limited license set forth in Section 11, Google acknowledges and agrees that it obtains no right, title or interest from you (or your licensors) under these Terms in or to any Content that you submit, post, transmit or display on, or through, the Services, including any intellectual property rights which subsist in that Content (whether those rights happen to be registered or not, and wherever in the world those rights may exist). Unless you have agreed otherwise in writing with Google, you agree that you are responsible for protecting and enforcing those rights and that Google has no obligation to do so on your behalf.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.5 You agree that you shall not remove, obscure, or alter any proprietary rights notices (including copyright and trade mark notices) which may be affixed to or contained within the Services.</div>\n<div>\n	&nbsp;</div>\n<div>\n	9.6 Unless you have been expressly authorized to do so in writing by Google, you agree that in using the Services, you will not use any trade mark, service mark, trade name, logo of any company or organization in a way that is likely or intended to cause confusion about the owner or authorized user of such marks, names or logos.</div>\n<div>\n	&nbsp;</div>\n<div>\n	10. License from Google</div>\n<div>\n	&nbsp;</div>\n<div>\n	10.1 Google gives you a personal, worldwide, royalty-free, non-assigna