not guarantee or warrant that files available for downloading from the Internet will be free of infection or viruses, worms, Trojan horses or other code that manifest contaminating or destructive properties.&nbsp; Each User is responsible for implementing sufficient procedures and checkpoints to satisfy User&rsquo;s particular requirements for accuracy of data input and output, and for maintaining a means external to the Web Site for the reconstruction of any lost data.&nbsp; The Company does not assume any responsibility or risk for User&rsquo;s use of the Internet.</p>\n\n<p>\n	The Company expressly disclaims any and all warranties with respect to any Content accessible within or through the Web Site, express or implied, including any implied warranty of merchantability, fitness for a particular purpose, title, or non-infringement.</p>\n\n\n	<h4>LIMITATION ON LIABILITY</h4>\n\n<p>\n	The Company, its Licensors, service providers, content providers, employees, agents, officers and directors will not be liable for any incidental, indirect, consequential, or special damages, including loss of revenue or income, pain and suffering, emotional distress or similar damages, even if the Company has been advised of the possibility of such damages.&nbsp; In no event will the collective liability of the Company and its Licensors, service providers, content providers, employees, agents, officers and directors to any party (regardless of the form of action, whether in contract, tort or otherwise) exceed the amount User has paid to the Company for the applicable Content or service out of with liability arose.</p>\n\n\n	<h4>INDEMNITY</h4>\n\n<p>\n	User will indemnify and hold the Company, its Licensors, content providers, service providers and contractors (the &ldquo;Indemnified Parties&rdquo;) harmless from any breach of these Terms and Conditions by User, including any use of Content other than as expressly authorized in these Terms and Conditions.&nbsp; User agrees that the Indemnified Parties will have no liability in connection with any such breach or unauthorized use, and agrees to indemnify any and all resulting loss, damages, judgments, awards, costs, expenses, and attorneys&rsquo; fees of the Indemnified Parties in connection therewith.&nbsp; User will also indemnify and hold the Indemnified Parties harmless from and against any claims brought by third parties arising out of User&rsquo;s use of information accessed from the Web Site.</p>\n\n\n	<h4>FORUMS</h4>\n\n<p>\n	Information posted on forums, bulletin boards, or similar portions of the Web Site (&ldquo;Forums&rdquo;) is supplied by third parties and other Users unless the Company or its authorized representative identifies itself as the content poster.&nbsp; Any opinions, advice, statements, services, offers, or other information or content expressed or made available by third parties or any other User are those of the respective author(s) and not of the Company.&nbsp; User will not post any of the following material in any Forum:</p>\n<ul><li>\n		Material with threatens or abuses others, or which is defamatory or libelous, or which is invasive of another&rsquo;s privacy;</li>\n	<li>\n		Material for which User does not have the right to post, including the proprietary material of any third party;</li>\n	<li>\n		Material which advocates illegal activity or discusses an intent to commit an illegal act;</li>\n	<li>\n		Material for advertising or solicitation;</li>\n	<li>\n		Material which is vulgar, obscene, pornographic, or indecent; or</li>\n	<li>\n		Material which does not pertain directly to the subject matter of the particular forum.</li>\n</ul><p>\n	The Company reserves the right to monitor Forums to determine compliance with these Terms and Conditions, as well as the right to remove or refuse to post any posting, including any of the above postings upon discovery thereof.&nbsp; Notwithstanding these rights, Users remain solely responsible for the content of its postings.&nbsp; User acknowledges and agrees that neither the Company nor any third party content provider will assume or have any liability for any action or inaction by the Company or any third party content provider with respect to any posting on the Forums.&nbsp; User will not (i) select or use a member name or email address of another person with the intent to impersonate that person; (ii) use a user name or email address subject to the rights of any person without authorization; (iii) use a member name in violation of the intellectual property rights of any person; or (iv) use a member name that the Company, in its sole discretion, deems offensive.</p>\n\n<p>\n	Further, User hereby grants Company the royalty-free, perpetual, irrevocable, non-exclusive right and license to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, perform and display any message posted in Forums (in whole or in part) worldwide or to incorporate any message in other works in any form, media or technology now known or later developed.</p>\n\n\n	<h4>MISCELLANEOUS</h4>\n\n<p>\n	<strong>Headings.&nbsp; </strong>The headings of sections of these Terms and Conditions are for ease of reference only and shall not be admissible in any action to alter, modify or interpret the contents of any section hereof.</p>\n\n<p>\n	<strong>Severability.&nbsp; </strong>If any section or provision of these Terms and Conditions are found to be illegal, unenforceable or in conflict with any law by a court of competent jurisdiction or arbitral tribunal, such section or provision of these Terms and Conditions shall be deemed severed from these Terms and Conditions and the validity of the remainder of these Terms and Conditions shall not be affected thereby.</p>\n\n<p>\n	<strong>Governing Law.&nbsp; </strong>These Terms and Conditions shall be governed by and construed in accordance with the laws of the state of Wyoming applicable to contracts made and to be enforced wholly within such