n its rights or delegate its duties under these Terms and Conditions except that (i) either party may assign its rights to receive payments under these Terms and Conditions to a secured creditor and (ii) either party may subcontract for the performance of any of its obligations under these Terms and Conditions.</p>\n\n<p>\n	<strong>Complete Agreement/Incorporation.&nbsp; </strong>These Terms and Conditions contain the complete understanding of the parties with respect to the subject matter hereof and supersedes all other agreements, understandings, communications and promises of any kind, whether oral or written, between such parties with respect to such subject matter.</p>'),
(97, 'aRichText', NULL, '<h3>How BookCheetah Works</h3>\n\n<h4>BookCheetah is as easy as 1-2-3</h4>\n\n	<ol><li>1. Sign up for a free account. It takes 3 minutes.</li>\n	<li>2. Add books you have to your bookshelf. Add books you want to your wishlist. You can list items for trade, borrow, rent or sale.</li>\n	<li>3. Let us find people near you, people who have what you want, or who want what you have.</li>\n	</ol><p>If you like a particular match, then buy a token to contact the seller (or buyer) and arrange a meeting.</p>\n	<p>This way, you can receive the book in person, saving on shipping and your carbon footprint. You won&iacute;t have to wait for shipping, or wonder about the actual condition of the book you are buying.</p>\n	<p>Plus, you''ll keep your book-buying dollars where they belong... in student pockets.</p>\n	<p>What do we charge? Just a matchmaking fee of $0.99 per token or &igrave;match&icirc;. For the price of a cheap iTunes track, you could find your next textbook.</p>\n	<p>And you can feel good about your tokens, because a share of every dollar we earn goes to your choice of three worthy charities: The Cheetah Conservation Fund, Teach for America, or the student government of your school. [insert links to CCF and TFA nearby]</p>'),
(98, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3</h4>\n<ol><li>\n		Sign up for a free account. It takes 3 minutes.</li>\n	<li>\n		Add books you have to your bookshelf. Add books you want to your wishlist. You can list items for trade, borrow, rent or sale.</li>\n	<li>\n		Let us find people near you, people who have what you want, or who want what you have.</li>\n</ol><p>\n	If you like a particular match, then buy a token to contact the seller (or buyer) and arrange a meeting.</p>\n<p>\n	This way, you can receive the book in person, saving on shipping and your carbon footprint. You won&iacute;t have to wait for shipping, or wonder about the actual condition of the book you are buying.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.</p>\n<p>\n	What do we charge? Just a matchmaking fee of $0.99 per token or &igrave;match&icirc;. For the price of a cheap iTunes track, you could find your next textbook.</p>\n<p>\n	And you can feel good about your tokens, because a share of every dollar we earn goes to your choice of three worthy charities: The Cheetah Conservation Fund, Teach for America, or the student government of your school. [insert links to CCF and TFA nearby]</p>'),
(99, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3</h4>\n<ol><li>\n		<a href="http://bc.kindendeavor.net/login"><strong>Sign up</strong> for a free account</a>. It takes 3 minutes.</li>\n	<li>\n		<strong>Add books you have</strong> to your bookshelf. <strong>Add books you want</strong> to your wishlist. You can list items for trade, borrow, rent or sale.</li>\n	<li>\n		Let us find people near you, people who have what you want, or who want what you have.</li>\n</ol><p>\n	If you like a particular match, then buy a token to contact the seller (or buyer) and arrange a meeting.</p>\n<p>\n	This way, <strong>you can receive the book in person, saving on shipping and your carbon footprint</strong>. You won&iacute;t have to wait for shipping, or wonder about the actual condition of the book you are buying.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.</p>\n<p>\n	<strong>What do we charge?</strong><br />\n	Just a matchmaking fee of $0.99 per token or "match". For the price of a cheap iTunes track, you could find your next textbook.</p>\n<p>\n	<strong>Feel good about your tokens</strong><br />\n	....because a share of every dollar we earn goes to your choice of three worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach for America</a>, or the student government of your school.</p>'),
(100, 'aRichText', NULL, '<p>\n	Thanks for contacting us here at BookCheetah.<br />\n	We are always looking for ways to improve, so we look forward to addressing your comment.</p>'),
(101, 'aRichText', NULL, '<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>\n<p>\n	If you''re new here, welcome! Accounts are free, so check out <a href="http://bc.kindendeavor.net/how-it-works">how they work</a> and then take 3 minutes to <a href="">create your account</a>.</p>\n<p>\n	If you&rsquo;re already familiar with BookCheetah, then welcome back! <a href="">Sign in</a> so that you can update your Bookshelf or Wishlist.</p>'),
(102, 'aRichText', NULL, '<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>\n<p>\n	If you''re new here, welcome! Accounts are free, so check out <a href="http://bc.kindendeavor.net/how-it-works">how they work</a> and then take 3 minutes to <a href="http://bc.kindendeavor.net/register">create your account</a>.</p>\n<p>\n	If you&rsquo;re already familiar with BookCheetah, then welcome back! <a href="http://bc.kindendeavor.net/login">Sign in</a> so that you can update your Bookshelf or Wishlist.</p>');
