also providing you an opportunity to opt-out or otherwise prohibit such unrelated uses.&nbsp; We never seek any more information except that which is absolutely necessary for the desired action to be completed.&nbsp; We do not place &ldquo;cookies&rdquo; (small text files) on your system for any reason.</p>\n\n<h4>OUR COMMITMENT TO DATA SECURITY</h4>\n\n<p>To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect online to protect the integrity of your data, at least as carefully as it would for BookCheetah&rsquo;s data, against modification, disclosure or destruction.&nbsp; In the event it is discovered that unauthorized access to data occurred, accidentally or otherwise, BookCheetah will attempt to immediately notify you and explain BookCheetah&rsquo;s remedial action.</p>\n\n<h4>OUR COMMITMENT TO CHILDREN&rsquo;S PRIVACY</h4>\n\n<p>Protecting the privacy of the very young is very important.&nbsp; For that reason, BookCheetah never collects or maintains information at our website from those we actually know are under 13, and no part of our web site is structured to attract anyone under 13.</p>\n\n<h4>HOW TO ACCESS OR CORRECT YOUR INFORMATION</h4>\n\n<p>You can access all your personally identifiable information that we collect online and maintain by reviewing your profile via the links on every page of our website.&nbsp; We use this procedure to better safeguard your information.</p>\n\n<p>You can correct factual errors in your personally identifiable information by changing your profile online, or by sending us a request that credibly shows error.&nbsp; You can, at any time, request that BookCheetah permanently erase any and all of your personal and identifiable information directly related to yourself at any time and BookCheetah will take action regarding your request as quickly as reasonably possible and notify you when the action is completed.</p>\n\n<p>To protect your privacy and security, we will also take reasonable steps to verify your identify before granting access or making corrections.</p>\n\n<h4>CHANGES REGARDING THIS PRIVACY AND ONLINE DATA COLLECTION NOTICE</h4>\n\n<p>BookCheetah reserves the right to change or modify the terms of this Privacy and Online Data Collection Notice and shall take reasonable action to notify BookCheetah users of any changes.</p>\n\n<h4>HOW TO CONTACT US</h4>\n\n<p>Should you have other questions or concerns about these privacy policies, please email us at info@bookcheetah.com.</p>'),
(105, 'aRichText', NULL, 'Oops, something went wrong.<br />\n	It seems the page you are looking for could not be found.\n<p>\n	We''re sorry for the inconvenience and appreciate your patience as we continue to work to improve our new site.</p>\n<p>\n	Would you mind taking a moment to&nbsp;<a href="mailto:info@bookcheetah.com?subject=I%20ended%20up%20at%20a%20404%20error%20page.">email us</a>&nbsp;and let us know how you got to this error page?</p>\n<p>\n	Or perhaps you''d simply like to return to the <a href="/">BookCheetah homepage</a>?</p>\n'),
(106, 'aRichText', NULL, '<h3>\n	Oops, something went wrong.<br />\n	It seems the page you are looking for could not be found.</h3>\n<hr><p>\n	We''re sorry for the inconvenience and appreciate your patience as we continue to work to improve our new site.</p>\n<p>\n	Would you mind taking a moment to&nbsp;<a href="mailto:info@bookcheetah.com?subject=I%20ended%20up%20at%20a%20404%20error%20page.">email us</a>&nbsp;and let us know how you got to this error page?</p>\n<p>\n	Or perhaps you''d simply like to return to the <a href="/">BookCheetah homepage</a>?</p>'),
(107, 'aRichText', NULL, '<h3>\n	Oops, something went wrong.<br />\n	It seems the page you are looking for could not be found.</h3>\n<p>\n	We''re sorry for the inconvenience and appreciate your patience as we continue to work to improve our new site.</p>\n<p>\n	Would you mind taking a moment to&nbsp;<a href="mailto:info@bookcheetah.com?subject=I%20ended%20up%20at%20a%20404%20error%20page.">email us</a>&nbsp;and let us know how you got to this error page?</p>\n<p>\n	Or perhaps you''d simply like to return to the <a href="/">BookCheetah homepage</a>?</p>'),
(108, 'aRichText', NULL, '<h3>\n	Oops, something went wrong.<br />\n	It seems the page you are looking for could not be found.</h3>\n<p>\n	We''re sorry for the inconvenience and appreciate your patience as we continue to work to improve our new site.</p>\n<p>\n	Would you mind taking a moment to&nbsp;<a href="mailto:info@bookcheetah.com?subject=I%20ended%20up%20at%20a%20404%20error%20page.">email us</a>&nbsp;and let us know how you got to this error page?</p>\n<p>\n	Or if you''d prefer, you can either hit your back button or head over to the <a href="/">BookCheetah homepage</a>.</p>'),
(109, 'aText', NULL, 'Terms Of Use'),
(110, 'aRichText', NULL, '<p>\n	We are always looking for ways to improve, so we look forward to addressing your comment.</p>'),
(111, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3</h4>\n<ol><li>\n		<a href="http://bc.kindendeavor.net/login"><strong>Sign up</strong> for a free account</a>. It takes 3 minutes.</li>\n	<li>\n		<strong>Add books you have</strong> to your bookshelf. <strong>Add books you want</strong> to your wishlist. You can list items for trade, borrow, rent or sale.</li>\n	<li>\n		Let us find people near you, people who have what you want, or who want what you have.</li>\n</ol><p>\n	If you like a particular match, then buy a token to contact the seller (or buyer) and arrange a meeting.</p>\n<p>\n	This way, <strong>you can receive the book in person, saving on shipping and your carbon footprint</strong>. You won''t have to wait for shipping, or wonder about the actual condition of the book you are buying.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.</p>\n<p>\n	<strong>What do we charge?</strong><br />\n	Just a matchmaking fee of $0.99 per token or "match". For the price of a cheap iTunes track, you could find your next textbook.</p>\n<p>\n	<strong>Feel good about your tokens</strong><br />\n	....because a share of every dollar we earn goes to your choice of three worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach for America</a>, or the student government of your school.</p>'),
(112, 'aRichText', NULL, '<p>\n	Thanks for contacting us here at Bookcheetah.<br />\n	We are always looking for ways to improve, so we look forward to addressing your comment.</p>'),
(113, 'aRichText', NULL, '<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>'),
(114, 'aRichText', NULL, '<h3>\n	Let us find the books you want, from other students on your campus.</h3>\n<h3>\n	Or let us find nearby students who want the books you no longer need.</h3>'),
(115, 'aRichText', NULL, '<p>\n	Thanks for contacting us here at Bookcheetah.<br />\n	We are always looking for ways to improve, so we look forward to addressing your comment.</p>'),
(116, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3-4-5</h4>\n<ol><li>\n		<a href="http://bc.kindendeavor.net/login"><strong>Sign up</strong> for a free account</a>. It takes 30 seconds: just your name, email, school and a password.</li>\n	<li>\n		Find a book by searching using its title, author or ISBN.&nbsp; We will help you verify that it''s the one you want, showing you the cover image and the price on Amazon.</li>\n	<li>\n		Add books you <b>want </b>to your <b>wishlist</b>. Add books you <b>have</b> to your <b>bookshelf</b>. You can choose how much to charge for each book on your bookshelf, how much you are willing to pay for each book on your wishlist.&nbsp; Or set a price of zero to permit negotiation on trades, loans, and rentals).</li>\n	<li>\n		We''ll search <b>near</b> you for people who have what you <b>want</b>, or who want what you <b>have</b>.&nbsp; We''ll show you the entire list of matches for free, so that you can decide if one or more of them is a good match for you.</li>\n	<li>\n		If you like a particular match, buy a token to contact them.&nbsp; Since they are nearby, you can arrange a meeting to inspect the book and exchange books for cash.</li>\n</ol><p>\n	<b>No shipping</b> means no waiting, no shipping costs, no carbon footprint of the courier service bringing it from across the nation.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.&nbsp; You won''t pay us at all for the books, just for the matchmaking.</p>\n<p>\n	<strong>What do we charge?</strong><br />\n	Tokens are available for less than 35 cents each.&nbsp; For the price of an iTunes track, you could find your next year''s textbooks.</p>\n<p>\n	<strong>Feel good about your tokens</strong><br />\n	....because a share of every dollar we earn goes to your choice of three worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach for America</a>, or the student government of your school.</p>'),
(117, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3-4-5</h4>\n<ol><li>\n		<a href="http://bc.kindendeavor.net/login"><strong>Sign up</strong> for a free account</a>. It takes 30 seconds: just your name, email, school and a password.</li>\n	<li>\n		Find a book by searching using its title, author or ISBN.&nbsp; We will help you verify that it''s the one you want, showing you the cover image and the price on Amazon.</li>\n	<li>\n		Add books you <b>want </b>to your <b>wishlist</b>. Add books you <b>have</b> to your <b>bookshelf</b>. You can choose how much to charge for each book on your bookshelf, how much you are willing to pay for each book on your wishlist.&nbsp; Or set a price of zero to permit negotiation on trades, loans, and rentals).</li>\n	<li>\n		We''ll search <b>near</b> you for people who have what you <b>want</b>, or who want what you <b>have</b>.&nbsp; We''ll show you the entire list of matches for free, so that you can decide if one or more of them is a good match for you.</li>\n	<li>\n		If you like a particular match, buy a token to contact them.&nbsp; Since they are nearby, you can arrange a meeting to inspect the book and exchange books for cash.</li>\n</ol><p>\n	<b>No shipping</b> means no waiting, no shipping costs, no carbon footprint of the courier service bringing it from across the nation.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.&nbsp; You won''t pay us at all for the books, just for the matchmaking.</p>\n<p>\n	<strong>What do we charge?</strong>&nbsp; Tokens are available for less than 35 cents each.&nbsp; For the price of an iTunes track, you could find your next year''s textbooks.</p>\n<p>\n	Notice that you can search both ways:&nbsp; search for sellers of books you want to buy, or search for buyers of books you want to sell.&nbsp; You never have to wait to be asked to dance.</p>\n<p>\n	<strong>Finally, feel good about your tokens</strong>.... because a share of every dollar we earn goes to your choice of three worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach for America</a>, or the student government of your school.</p>'),
(118, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	BookCheetah is as easy as 1-2-3-4-5</h4>\n<ol><li>\n		<a href="http://bc.kindendeavor.net/register"><strong>Sign up</strong> for a free account</a>. It takes 30 seconds: just your name, email, school and a password.</li>\n	<li>\n		Find a book by searching using its title, author or ISBN.&nbsp; We will help you verify that it''s the one you want, showing you the cover image and the price on Amazon.</li>\n	<li>\n		Add books you <b>want </b>to your <b>wishlist</b>. Add books you <b>have</b> to your <b>bookshelf</b>. You can choose how much to charge for each book on your bookshelf, how much you are willing to pay for each book on your wishlist.&nbsp; Or set a price of zero to permit negotiation on trades, loans, and rentals).</li>\n	<li>\n		We''ll search <b>near</b> you for people who have what you <b>want</b>, or who want what you <b>have</b>.&nbsp; We''ll show you the entire list of matches for free, so that you can decide if one or more of them is a good match for you.</li>\n	<li>\n		If you like a particular match, buy a token to contact them.&nbsp; Since they are nearby, you can arrange a meeting to inspect the book and exchange books for cash.</li>\n</ol><p>\n	<b>No shipping</b> means no waiting, no shipping costs, no carbon footprint of the courier service bringing it from across the nation.</p>\n<p>\n	Plus, you''ll keep your book-buying dollars where they belong... in student pockets.&nbsp; You won''t pay us at all for the books, just for the matchmaking.</p>\n<p>\n	<strong>What do we charge?</strong>&nbsp; Tokens are available for less than 35 cents each.&nbsp; For the price of an iTunes track, you could find your next year''s textbooks.</p>\n<p>\n	Notice that you can search both ways:&nbsp; search for sellers of books you want to buy, or search for buyers of books you want to sell.&nbsp; You never have to wait to be asked to dance.</p>\n<p>\n	<strong>Finally, feel good about your tokens</strong>.... because a share of every dollar we earn goes to your choice of three worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach for America</a>, or the student government of your school.</p>'),
