(139, 'aRichText', NULL, '<h3>\n	Let us find the books you want, from other students <a href="/how-it-works" style=""><span style="color:    #d6b000;">on your campus</span></a>.</h3>\n<h3>\n	Or let us find <span style="color:      #d6b000;">nearby</span> students who want the books you no longer need.</h3>\n<p>\n	<strong>Local, student to student.<br />\n	No shipping. No bookstore.<br />\n	Fast. Cheap.</strong></p>'),
