ens</strong>.... because a share of every dollar we earn goes to your choice of two worthy charities: <a href="http://www.cheetah.org/">The Cheetah Conservation Fund</a>&nbsp;or the student government of your school.</p>'),
(160, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h3>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h3>\n<ol><li>\n		<b>REGISTER: </b><a href="http://www.bookcheetah.com/register">Sign up</a> for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong> Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong> Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong> BookCheetah finds people who have what you need (your wishlist) or need what you have (your bookshelf). Buy tokens to get introduced and set up a time and place to exchange cash for books.</li>\n</ol><h3>\n	Why Bookcheetah?</h3>\n<ul><li>\n		<strong>Student-to-student</strong> = no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong> = quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Cheap tokens</strong> = For the price of an iTunes track, buy tokens to rendezvous with students on campus.</li>\n	<li>\n		<strong>Do good</strong> = You decide how a portion of all BookCheetah proceeds get spent. We support the Cheetah Conservation Fund and the student government of <em>your</em> school. Choose when you purchase tokens.</li>\n</ul>'),
