onditions or pertaining to the subject matter hereof may be had in the District Court for the city of Cheyenne of the state of Wyoming or in the state courts of Wyoming sitting in a district or county court in Wyoming.</p>\n<p>\n	<strong>Dispute Resolution.</strong>&nbsp; Any and all claims, causes of action or disputes, regardless of theory, between You and BookCheetah arising out of or related to the Terms and Conditions, BookCheetah or the Content accessed through the Web Site shall be governed by the laws of the State of Wyoming without regard to conflict or choice of law principles.&nbsp; You and BookCheetah agree that any such claims, causes of action or disputes shall be brought exclusively in courts located within the District Court for the city of Cheyenne of the state of Wyoming.&nbsp; You further agree that, regardless of any statute or law to the contrary, You must file any such claim or cause of action within one year after such claim or cause of action arose or be forever barred.</p>\n<p>\n	<strong>Notices.&nbsp; </strong>All notices or other written communications required or permitted under these Terms and Conditions shall be given in writing by courier or reputable overnight delivery services, or by certified mail, return receipt requested to either party at its address set forth below (or to such address as such party may subsequently indicate in writing in the manner specified in this section.)</p>\n<p>\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BookCheetah, LLC</p>\n<p>\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c/o CT Corporation Systems</p>\n<p>\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1720 Carey Ave</p>\n<p>\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cheyenne, WY 82001</p>\n<p>\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (800) 362-1228</p>\n<p>\n	<strong>Waivers and Amendments.&nbsp; </strong>The waiver by either party of any provision of these Terms and Conditions on any occasio