></p>\n<p>\n	You acknowledge and agree that any violation or breach of these Terms and Conditions may cause BookCheetah immediate and irreparable harm and damages.&nbsp; Consequently, BookCheetah has the right to, and may in its discretion, immediately obtain preliminary injunctive relief, including without limitation, temporary restraining orders, and seek permanent injunctive relief regarding any violation or breach of the Terms and Conditions.&nbsp; In addition to any and all other remedies available to BookCheetah in law or in equity, BookCheetah may seek specific performance of any term in the Terms and Conditions.</p>\n<p>\n	<br /><strong>MISCELLANEOUS</strong></p>\n<p>\n	<br /><strong>Headings.&nbsp; </strong>The headings of sections of these Terms and Conditions are for ease of reference only and shall not be admissible in any action to alter, modify or interpret the contents of any section hereof.</p>\n<p>\n	<br /><strong>Severability.&nbsp; </strong>If any section or provision of these Terms and Conditions are found to be illegal, unenforceable or in conflict with any law by a court of competent jurisdiction or arbitral tribunal, such section or provision of these Terms and Conditions shall be deemed severed from these Terms and Conditions and the validity of the remainder of these Terms and Conditions shall not be affected thereby.</p>\n<p>\n	<br /><strong>Governing Law.&nbsp; </strong>These Terms and Conditions shall be governed by and construed in accordance with the laws of the state of Wyoming applicable to contracts made and to be enforced wholly within such state.</p>\n<p>\n	<br /><strong>Submission to Jurisdiction.&nbsp; </strong>The parties to these Terms and Conditions each specifically consent to jurisdiction in Wyoming in connection with any dispute between the parties arising out of these Terms and Conditions or pertaining to the subject matter hereof.</p>\n<p>\n	<br /><strong>Venue.&nbsp; </strong>The parties to these Terms and Conditions eac