.&nbsp; </strong>The waiver by either party of any provision of these Terms and Conditions on any occasion and upon any particular circumstances shall not operate as a waiver of such provision of these Terms and Conditions on any other occasion or upon any other circumstances.&nbsp; These Terms and Conditions maybe waived or amended only in writing and signed by both parties.</p>\n<p>\n	<br /><strong>Survival.&nbsp; </strong>These Terms and Conditions, and any other provision which includes but is not limited to, Proprietary Information, Disclaimers, Limitations on Liability, Indemnity, Injunctive Relief, and Miscellaneous, in accordance with its terms are intended to survive these Terms and Conditions, shall survive the expiration or termination of these Terms and Conditions for any reason.</p>\n<p>\n	<br /><strong>Assignment.&nbsp; </strong>Neither party may assign its rights or delegate its duties under these Terms and Conditions except that (i) either party may assign its rights to receive payments under these Terms and Conditions to a secured creditor and (ii) either party may subcontract for the performance of any of its obligations under these Terms and Conditions.</p>\n<p>\n	<br /><strong>Complete Agreement/Incorporation.&nbsp; </strong>These Terms and Conditions contain the complete understanding of the parties with respect to the subject matter hereof and supersedes all other agreements, understandings, communications and promises of any kind, whether oral or written, between such parties with respect to such subject matter.&nbsp; Other than BookCheetah&rsquo;s Representatives, who are expressly including as named third-party beneficiaries of the Terms and Conditions, there are no third-party beneficiaries to the Terms and Conditions.</p>'),
(172, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h4>\n<ol><li>\n		<b>REGISTER: </b><a href="http://www.bookcheetah.com/register">Sign up</a> for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong> Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong> Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong> BookCheetah finds people who have what you need (your wishlist) or need what you have (your bookshelf). Buy tokens to get introduced and set up a time and place to exchange cash for books.</li>\n</ol><h4>\n	Why Bookcheetah?</h4>\n<ul><li>\n		<strong>Student-to-student</strong> = no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong> = quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Cheap tokens</strong> = For the price of an iTunes track, buy tokens to rendezvous with students on campus.</li>\n	<li>\n		<strong>Do good</strong> = You decide how a portion of all BookCheetah proceeds get spent. We support the Cheetah Conservation Fund and the student government of <em>your</em> school. Choose when you purchase tokens.</li>\n</ul>'),
(173, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h4>\n<ol><li>\n		<b>REGISTER: </b><a href="http://www.bookcheetah.com/register">Sign up</a> for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong> Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong> Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong> BookCheetah finds people who have what you need (your wishlist) or need what you have (your bookshelf). Buy tokens to get introduced and set up a time and place to exchange cash for books.</li>\n</ol><h4>\n	Why Bookcheetah?</h4>\n<ul><li>\n		<strong>Student-to-student</strong> = no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong> = quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Cheap tokens</strong> = For the price of an iTunes track, buy tokens to rendezvous with students on campus.</li>\n	<li>\n		<strong>Do good</strong> = You decide how a portion of all BookCheetah proceeds get spent. We support the Cheetah Conservation Fund and the student government of <em>your</em> school. Choose when you purchase tokens.</li>\n</ul>'),
(174, 'aRichText', NULL, '<h3>\n	How BookCheetah Works</h3>\n<h4>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h4>\n<ol><li>\n		<b>REGISTER: </b><a href="http://www.bookcheetah.com/register">Sign up</a> for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong> Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong> Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong> BookCheetah finds people who have what you need (your wishlist) or need what you have (your bookshelf). Buy tokens to get introduced and set up a time and place to exchange cash for books.</li>\n</ol><h4>\n	Why Bookcheetah?</h4>\n<ul><li>\n		<strong>Student-to-student</strong> = no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong> = quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Cheap tokens</strong> = For the price of an iTunes track, buy tokens to rendezvous with students on campus.</li>\n	<li>\n		<strong>Do good</strong> = You decide how a portion of all BookCheetah proceeds get spent. We support the Cheetah Conservation Fund and the student government of <em>your</em> school. Choose when you purchase tokens.</li>\n</ul>'),
(175, 'aRichText', NULL, '<h3>\n	<span style="">How BookCheetah Works</span></h3>\n<h4>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h4>\n<ol><li>\n		<b>REGISTER:&nbsp;</b><a href="http://www.bookcheetah.com/register">Sign up</a>&nbsp;for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong>&nbsp;Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong>&nbsp;Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong>&nbsp;Set up a time and place to exchange cash for books.</li>\n</ol><h4>\n	Why Bookcheetah?</h4>\n<ul><li>\n		<strong>Student-to-student</strong>&nbsp;= no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong>&nbsp;= quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Free</strong>&nbsp;= Free accounts, free to use. Simple enough.</li>\n	<li>\n		<strong>Do good</strong>&nbsp;= If we help to save you money, donate to keep us free!&nbsp; Then decide how ten percent of all BookCheetah proceeds is spent:&nbsp; the Cheetah Conservation Fund, Teach For America or the student government of&nbsp;<em>your</em>&nbsp;school.</li>\n</ul>'),
(176, 'aRichText', NULL, '<h3>\n	Find the books you want, from other students.</h3>\n<h3>\n	Or find nearby students who want the books you no longer need.</h3>\n<h3>\n	We''re a free, student-to-student textbook marketplace. &nbsp;<a href="/register">Join us</a>.</h3>'),
(177, 'aRichText', NULL, '<h3>\n	<span style="">How BookCheetah Works</span></h3>\n<h4>\n	Using BookCheetah: REGISTER. SEARCH. POST. MEET.</h4>\n<ol><li>\n		<b>REGISTER:&nbsp;</b><a href="http://www.bookcheetah.com/register">Sign up</a>&nbsp;for a free account. Just need a name, email, and school.</li>\n	<li>\n		<strong>SEARCH:</strong>&nbsp;Find the books you need for upcoming classes and add them to your wishlist.</li>\n	<li>\n		<strong>POST:</strong>&nbsp;Add your old books for sale on your bookshelf. You set the price.</li>\n	<li>\n		<strong>MEET:</strong>&nbsp;Set up a time and place to exchange cash for books.</li>\n</ol><h4>\n	Why Bookcheetah?</h4>\n<ul><li>\n		<strong>Student-to-student</strong>&nbsp;= no ridiculous bookstore prices and you set your selling price. Money stays with fellow students-- not some faceless bookstore owner.&nbsp;</li>\n	<li>\n		<strong>No shipping</strong>&nbsp;= quicker, cheaper, and greener.&nbsp;</li>\n	<li>\n		<strong>Free</strong>&nbsp;= Free accounts, free to use. Simple enough.</li>\n	<li>\n		<strong>Do good</strong>&nbsp;=&nbsp;If we help to save you money, donate to keep us free! &nbsp;Then decide how ten percent of all BookCheetah proceeds is spent: the <a href="http://www.cheetah.org/">Cheetah Conservation Fund</a>, <a href="http://www.teachforamerica.org/">Teach For America</a> or the student government of your school.</li>\n</ul>');
