mited to email addresses, IP addresses and telephone numbers, is not allowed for any purpose.&nbsp; All copying, aggregation, display, distribution, performance or derivative use of BookCheetah or any Content posted on BookCheetah whether done directly or through intermediaries, including by any electronic means, is prohibited.</p>\n<p>\n	<br /><strong>CONTENT AND MODERATION</strong></p>\n<p>\n	Information posted on forums, bulletin boards, or similar portions of the Web Site (&ldquo;Forums&rdquo;) is supplied by third parties and other users unless BookCheetah or its authorized representative identifies itself as the content poster.&nbsp; Any opinions, advice, statements, services, offers, or other information or content expressed or made available by third parties or any other user are those of the respective author(s) and not of BookCheetah.&nbsp; BookCheetah does not control, is not responsible for and makes no representations or warranties with respect to any user Content.&nbsp; You must conduct any necessary, appropriate, prudent or judicious investigation, inquiry, research and due diligence with respect to any user Content.&nbsp; You are also responsible for any Content that You post or transmit and, if You create an account, You are responsible for all Content posted or transmitted through or by use of Your account.</p>\n<p>\n	User will not post any of the following Content:</p>\n<ul><li>\n		Content which threatens or abuses others, or which is defamatory or libelous, or which is invasive of another&rsquo;s privacy;</li>\n	<li>\n		Content for which User does not have the right to post, including the proprietary material of any third party and or disclosure of another person&rsquo;s personal, confidential or proprietary information;</li>\n	<li>\n		Illegal Content;</li>\n	<li>\n		Content used in the facilitation of the creation, advertising, distribution, provision or receipt of illegal goods or services;</li>\n	<li>\n		False or fraudulent Content;</li>\n	<li>\n		Content for advertising or solicitation;</li>\n	<li>\n		Offensive Content which is defamatory, threatening, indecent, vulgar, obscene, or pornographic;</li>\n	<li>\n		Malicious Content including, without limitation, malware or spyware;</li>\n	<li>\n		Content that offers, promotes, advertises, or provides links to posting or auto-posting products or services, account creation or auto-creation products or services, flagging or auto-flagging products or services, bulk telephone numbers or any other product or service that if utilized with respect to BookCheetah would violate these Terms and Conditions;</li>\n	<li>\n		Content that offers, promotes, advertises or provides links to unsolicited products or services; or</li>\n	<li>\n		Material which does not pertain directly to the subject matter of the particular Forum.</li>\n</ul><p>\n	<br />\n	You automatically grant and assign to BookCheetah, and You represent and warrant that You have the right to grant and assign to BookCheetah, a perpetual, irrevocable, unlimited, non-exclusive, royalty-free, fully sub-licensable, worldwide, license to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, perform and display any message posted in Forums (in whole or in part) worldwide or to incorporate any message in other works in any form, media or technology now known or later developed. &nbsp;You also expressly grant and assign to BookCheetah all rights and causes of action to prohibit and enforce against any unauthorized copying, performance, display, distribution, use or exploitation of, or creation of derivative works from, any Content that You post including but not limited to any unauthorized downloading, extraction, harvesting, collection or aggregation of Content that You post.</p>\n<p>\n	BookCheetah reserves the right, but not the obligation, to monitor Forums and to regulate content and to regulate conduct by any User to enforce compliance with these Terms and Conditions for any reason and in any manner or by any means that BookCheetah in its sole discretion, deems necessary or appropriate, as well as the right to remove or refuse to post any posting, including any of the above postings upon discovery thereof.</p>\n<p>\n	You also understand and agree that any action or inaction by BookCheetah or any of its directors, officers, members, employees, consultants, agents or other representatives (collectively, &ldquo;Representatives&rdquo;) to prevent, restrict, redress or regulate content, or to implement other enforcement measures against any content, conduct or potential Terms and Conditions violation is undertaken voluntarily and in good faith, and You expressly agree that neither BookCheetah nor any of BookCheetah&rsquo;s Representatives shall be liable to You or anyone else for any action or inaction to prevent, restrict, redress, or regulate content, or to implement other enforcement measures against any content, conduct or potential violation of the Terms and Conditions.</p>\n<p>\n	BookCheetah also has the right in its sole discretion to limit, modify, interrupt, suspend or discontinue all or any portions of the BookCheetah Web Site at any time without notice.&nbsp; BookCheetah and its Representatives shall not be liable for any such limitations, modifications, interruptions, or suspensions or discontinuance, or any purported losses, harm or damages arising from or related thereto.</p>\n<p>\n	Notwithstanding these rights, Users remain solely responsible for the content of its postings.&nbsp; User acknowledges and agrees that neither BookCheetah nor any third party content provider will assume or have any liability for any action or inaction by BookCheetah or any third party content provider with respect to any posting on the Forums.&nbsp; User will not (i) select or use a member name or email address of another person with the intent to impersonate that person; (ii) use a user name or email address subject to the rights of any person without authorization; (iii) use a member name in violation of the intellectual property rights of any person; or (iv) use a member name that BookCheetah, in its sole discretion, deems offensive.</p>\n<p>\n	<br /><strong>CONDUCT</strong></p>\n<p>\n	BookCheetah does not control, is not responsible for and makes no representations or warranties with respect to any user or user conduct.&nbsp; You are solely responsibility for Your interaction with or reliance on any user or user conduct.&nbsp; You must perform any necessary, appropriate, prudent or judicious investigation, inquiry, research and due diligence with respect to any user or user conduct.&nbsp; You are also responsible for Your own conduct and activities on, through or related to BookCheetah, and, if You create an account on BookCheetah, You are responsible for all conduct or activities on, through or by use of Your account.</p>\n<p>\n	<br /><strong>PROPRIETARY INFORMATION</strong></p>\n<p>\n	User acknowledges and agrees that the Content accessible within the Web Site is the proprietary information of BookCheetah and its content providers and BookCheetah and its content providers retain all right, title, and interest in the Content.&nbsp; Accordingly, User will not reproduce, transmit, publish or distribute such Content to any third party without the prior express written consent of BookCheetah or the applicable content provider except that User may print a copy of the Content solely for User&rsquo;s personal use.&nbsp; In doing so, User will not remove or alter, or cause to be removed or altered, any copyright, trademark, trade name, service mark, or any other proprietary notice or legend appearing on any of the Content.</p>\n<p>\n	<br /><strong>DISCLAIMERS</strong></p>\n<p>\n	User will have access to a variety of sources of content through the internet.&nbsp; BookCheetah has made no effort to verify the accuracy or suitability of any information contained in any such sources.&nbsp; Accordingly, BookCheetah will have no liability or responsibility whatsoever for any content contained within any such sources.&nbsp; User accesses, uses, and relies upon such content at User&rsquo;s own risk.&nbsp; User understands further that the Internet contains unedited materials, some of which are sexually explicit or may be offensive.&nbsp; User accesses such materials at User&rsquo;s own risk.&nbsp; BookCheetah has no control over and accepts no responsibility whatsoever for such materials.</p>\n<p>\n	User understands that, except for information, products or services clearly identified as being supplied by BookCheetah, BookCheetah does not operate, control or endorse any information, products or services on the Internet in any way.&nbsp; User also understands that while no downloading of material is necessary for use of the service, BookCheetah cannot and does not guarantee or warrant that files available for downloading from the Internet will be free of infection or viruses, worms, Trojan horses or other code that manifest contaminating or destructive properties.&nbsp; Each User is responsible for implementing sufficient procedures and checkpoints to satisfy User&rsquo;s particular requirements for accuracy of data input and output, and for maintaining a means external to the Web Site for the reconstruction of any lost data.&nbsp; BookCheetah does not assume any responsibility or risk for User&rsquo;s use of the Internet.</p>\n<p>\n	YOUR ACCESS TO, USE OF AND RELIANCE ON BOOKCHEETAH AND CONTENT ACCESSED THROUGH BOOKCHEETAH IS ENTIRELY AT YOUR OWN RISK.&nbsp; THE BOOKCHEETAH WEB SITE, INCLUDING WITHOUT LIMITATION, THE WEB SITE, THE WEB SITE&rsquo;S PROGRAMS, SERVICES, FORUMS AND CONTENT,&nbsp; IS PROVIDED ON AN &ldquo;AS IS&rdquo; OR &ldquo;AS AVAILABLE&rdquo; BASIS WITHOUT ANY WARRANTIES OF ANY KIND.</p>\n<p>\n	ALL EXPRESS AND IMPLIED WARRANTIES (INCLUDING, WITHOUT LIMITATION, WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, AND NON-INFRINGEMENT OF PROPRIETARY RIGHTS) ARE EXPRESSLY DISCLAIMED.&nbsp;</p>\n<p>\n	WITHOUT LIMITING THE FOREGOING, BOOKCHEETAH ALSO DISCLAIMS ALL WARRANTIES FOR OR WITH RESPECT TO: (a) THE SECURITY, RELIABILITY, TIMELINESS, ACCURACY AND PERFORMANCE OF BOOKCHEETAH AND CONTENT ACCESSED THROUGH BOOKCHEETAH; (b) COMPUTER WORMS, VIRUSES, SPYWARE, ADWARE AND ANY OTHER MALWARE, MALICIOUS CODE OR HARMFUL CONTENT OR COMPONENTS ACCESSED, RECEIVED OR DISSEMINATED THROUGH, RELATED TO OR AS A RESULT OF BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH; (c) ANY TRANSACTIONS OR POTENTIAL TRANSACTIONS, GOODS OR SERVICES PROMISED OR EXCHANGED, INFORMATION OR ADVICE OFFERED OR EXCHANGED, OR OTHER CONTENT, INTERACTIONS, REPRESENTATIONS OR COMMUNICATIONS THROUGH, RELATED TO OR AS A RESULT OF USE OF BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH (INCLUDING, WITHOUT LIMITATION, ACCESSED THROUGH ANY LINKS ON BOOKCHEETAH OR IN CONTENT.)</p>\n<p>\n	THESE DISCLAIMERS SHALL APPLY TO THE FULLEST EXTENT PERMITTED BY LAW.&nbsp; Some jurisdictions do not allow disclaimer of implied warranties.&nbsp; In such jurisdictions, some of the foregoing disclaimers as to implied warranties may not apply.</p>\n<p>\n	<br /><strong>LIMITATIONS ON LIABILITY</strong></p>\n<p>\n	BookCheetah and its Representatives will not be liable for any incidental, indirect, consequential, or special damages, including loss of revenue or income, pain and suffering, emotional distress or similar damages, even if BookCheetah has been advised of the possibility of such damages.&nbsp; You expressly waive the provisions of California Civil Code Section 1542 (and any similar laws in other jurisdictions) which provides &ldquo;[A] general release does not extend to claims which the creditor does not know or suspect to exist in his favor at the time of executing the release, which, if known by him must have materially affected his settlement with the debtor.&rdquo; In no event will the collective liability of BookCheetah and its Representatives to any party (regardless of the form of action, whether in contract, tort or otherwise) exceed the amount User has paid to BookCheetah for the applicable Content or service out of which liability arose.</p>\n<p>\n	BOOKCHEETAH AND ITS REPRESENTATIVES SHALL UNDER NO CIRCUMSTANCE BE LIABLE FOR ANY ACCESS TO, USE OR RELIANCE ON BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH BY YOU OR ANYONE ELSE, OR FOR ANY TRANSACTIONS, COMMUNICATIONS, INTERACTIONS, DISPUTES OR RELATIONS BETWEEN YOU AND ANY OTHER PERSON OR ORGANIZATION ARISING OUT OF OR RELATED TO BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH INCLUDING BUT NOT LIMITED TO LIABILITY FOR INJUNCTIVE RELIEF AS WELL AS FOR ANY HARM, INJURY, LOSS OR DAMAGES OF ANY KIND INCURRED BY YOU OR ANYONE ELSE (INCLUDING WITHOUT LIMITATION, DIRECT, INDIRECT, INCIDENTAL, SPECIAL, CONSEQUENTIAL, STATUORY, EXEMPLARY OR PUNITIVE DAMAGES, EVEN IF BOOKCHEETAH OR ANY BOOKCHEETAH REPRESENTATIVE HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES).&nbsp; THIS LIMITATION OF LIABILITY APPLIES REGARDLESS OF, BUT IS NOT RESTRICTED TO, WHETHER THE ALLEGED LIABILITY, HARM, INJURY, LOSS OR DAMAGES AROSE FROM AUTHORIZED OR UNAUTHORIZED ACCESS TO OR USE OF BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH; ANY INABILITY TO ACCESS OR USE BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH; OR ANY REMOVAL, DELETION, LIMITATION, MODIFICATION, INTERRUPTION, SUSPENSION, DISCONTINUANCE OR TERMINATION OF BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH.</p>\n<p>\n	THESE LIMITATIONS SHALL ALSO APPLY WITH RESPECT TO DAMAGES RESULTING FROM ANY TRANSACTIONS OR POTENTIAL TRANSACTIONS, GOODS OR SERVICES PROMISED OR EXCHANGED, INFORMATION OR ADVICE OFFERED OR EXCHANGED, OR OTHER CONTENT, INTERACTIONS, REPRESENTATIONS, COMMUNICATIONS OR RELATIONS THROUGH, RELATED TO OR AS A RESULT OF BOOKCHEETAH OR CONTENT ACCESSED THROUGH BOOKCHEETAH (INCLUDING, WITHOUT LIMITATION, ANY LINKS ON BOOKCHEETAH AND LINKS IN CONTENT ACCESSED THROUGH BOOKCHEETAH).</p>\n<p>\n	<br /><strong>IN